$(document).ready(function(){$(document).on("click",".test-start",function(){localStorage.setItem("currQuest",0),localStorage.removeItem("timeLast")}),$(document).on("input",".term-search",function(){var o=$(this).val().toLowerCase();$.each($(".term-title"),function(t,e){$(e).text().toLowerCase().match("^"+o)?($(e).show(),$(e).next("p").show()):($(e).hide(),$(e).next("p").hide())}),0==$(".term-title:visible").length?$(".not-found").show():$(".not-found").hide()})});